import React from 'react';
import './AddReservationForm.css'; // Make sure to create this CSS file

const AddReservationForm = ({ onClose }) => {
  // Form submission handler
  const handleSubmit = (e) => {
    e.preventDefault();
    // Here you would handle the submission of the reservation data
    console.log("Reservation data submitted");
    onClose(); // Close the popup after submission
  };

  return (
    <div className="add-reservation-popup">
      <div className="add-reservation-content">
        <h2>Direct renting</h2>
        <form onSubmit={handleSubmit}>
          {/* Include all your form fields here */}
          <button type="submit">Confirm payment</button>
        </form>
        <button onClick={onClose} className="close-btn">X</button>
      </div>
    </div>
  );
};

export default AddReservationForm;
